assert_eq!(a.iter().rposition(|&x| x == 5), None);
```

Stopping at the first `true`:

```
let a = [-1, 2, 3, 4];

let mut iter = a.iter();

assert_eq!(iter.rposition(|&x| x >= 2), Some(3));

// we can still use `iter`, as there are more elements.
assert_eq!(iter.next(), Some(&-1));
```

