assert_eq!(set.len(), 3);
assert_eq!(set.get_or_insert(2), &2);
assert_eq!(set.get_or_insert(100), &100);
assert_eq!(set.len(), 4); // 100 was inserted
```

0:697:1674.docs:
Inserts a key-value pair into the map.

If the map did not have this key present, [`None`] is returned.

If the map did have this key present, the value is updated, and the old
value is returned. The key is not updated, though; this matters for
types that can be `==` without being identical. See the [`std::collections`]
[module-level documentation] for more.

[`None`]: https://doc.rust-lang.org/std/option/enum.Option.html#variant.None
[`std::collections`]: https://doc.rust-lang.org/std/collections/index.html
[module-level documentation]: https://doc.rust-lang.org/std/collections/index.html#insert-and-complex-keys

# Examples

```
use hashbrown::HashMap;

let mut map = HashMap::new();
assert_eq!(map.insert(37, "a"), None);
assert_eq!(map.is_empty(), false);

map.insert(37, "b");
assert_eq!(map.insert(37, "c"), Some("b"));
assert_eq!(map[&37], "c");
```

0:672:2757.docs:
Attempts to get mutable references to `N` values in the map at once, with immutable
references to the corresponding keys, without validating that the values are unique.

Returns an array of length `N` with the results of each query. `None` will be returned if
any of the keys are missing.

For a safe alternative see [`get_many_key_value_mut`](`HashMap::get_many_key_value_mut`).

# Safety

Calling this method with overlapping keys is *[undefined behavior]* even if the resulting
references are not used.

[undefined behavior]: https://doc.rust-lang.org/reference/behavior-considered-undefined.html

# Examples

```
use hashbrown::HashMap;

let mut libraries = HashMap::new();
libraries.insert("Bodleian Library".to_string(), 1602);
libraries.insert("Athenum".to_string(), 1807);
libraries.insert("Herzogin-Anna-Amalia-Bibliothek".to_string(), 1691);
libraries.insert("Library of Congress".to_string(), 1800);

let got = libraries.get_many_key_value_mut([
    "Bodleian Library",
    "Herzogin-Anna-Amalia-Bibliothek",
]);
assert_eq!(
    got,
    Some([
        (&"Bodleian Library".to_string(), &mut 1602),
        (&"Herzogin-Anna-Amalia-Bibliothek".to_string(), &mut 1691),
    ]),
);
// Missing keys result in None
let got = libraries.get_many_key_value_mut([
    "Bodleian Library",
    "Gewandhaus",
]);
assert_eq!(got, None);
```

0:596:2444.docs:
Creates an empty `HashMap` which will use the given hash builder to hash
keys.

The hash map is initially created with a capacity of 0, so it will not
allocate until it is first inserted into.

Warning: `hash_builder` is normally randomly generated, and
is designed to allow HashMaps to be resistant to attacks that
cause many collisions and very poor performance. Setting it
manually using this function can expose a DoS attack vector.

The `hash_builder` passed should implement the [`BuildHasher`] trait for
the HashMap to be useful, see its documentation for details.

# Examples

```
use hashbrown::HashMap;
use hashbrown::hash_map::DefaultHashBuilder;

let s = DefaultHashBuilder::default();
let mut map = HashMap::with_hasher(s);
assert_eq!(map.len(), 0);
assert_eq!(map.capacity(), 0);

map.insert(1, 2);
```

[`BuildHasher`]: https://doc.rust-lang.org/std/hash/trait.BuildHasher.html

0:1004:3167.docs:
Creates a `RawEntryMut` from the given hash and matching function.

# Examples

```
use core::hash::{BuildHasher, Hash};
use hashbrown::hash_map::{HashMap, RawEntryMut};

fn compute_hash<K: Hash + ?Sized, S: BuildHasher>(hash_builder: &S, key: &K) -> u64 {
    use core::hash::Hasher;
    let mut state = hash_builder.build_hasher();
    key.hash(&mut state);
    state.finish()
}

let mut map: HashMap<&str, u32> = HashMap::new();
let key = "a";
let hash = compute_hash(map.hasher(), &key);
let entry: RawEntryMut<&str, u32, _> = map.raw_entry_mut().from_hash(hash, |k| k == &key);
entry.insert(key, 100);
assert_eq!(map[&"a"], 100);
```

0:1748:2579.docs:
Drains elements which are true under the given predicate,
and returns an iterator over the removed items.

In other words, move all elements `e` such that `f(&e)` returns `true` out
into another iterator.

When the returned DrainedFilter is dropped, any remaining elements that satisfy
the predicate are dropped from the set.

# Examples

```
use hashbrown::HashSet;

let mut set: HashSet<i32> = (0..8).collect();
let drained: HashSet<i32> = set.drain_filter(|v| v % 2 == 0).collect();

let mut evens = drained.into_iter().collect::<Vec<_>>();
let mut odds = set.into_iter().collect::<Vec<_>>();
evens.sort();
odds.sort();

assert_eq!(evens, vec![0, 2, 4, 6]);
assert_eq!(odds, vec![1, 3, 5, 7]);
```

0:631:1970.docs:
Shrinks the capacity of the map with a lower limit. It will drop
down no lower than the supplied limit while maintaining the internal rules
and possibly leaving some space in accordance with the resize policy.

This function does nothing if the current capacity is smaller than the
supplied minimum capacity.

# Examples

```
use hashbrown::HashMap;

let mut map: HashMap<i32, i32> = HashMap::with_capacity(100);
map.insert(1, 2);
map.insert(3, 4);
assert!(map.capacity() >= 100);
map.shrink_to(10);
assert!(map.capacity() >= 10);
map.shrink_to(0);
assert!(map.capacity() >= 2);
map.shrink_to(10);
assert!(map.capacity() >= 2);
```

